function calculateSubmatrices(matrix) {
    var rows = matrix.length;
    var columns = matrix[0].length;
    var submatrixSizes = new Array(rows);
    for (var i = 0; i < rows; i++) {
        submatrixSizes[i] = new Array(columns).fill(0);
    }
    var totalSubmatrices = 0;
    for (var i = 0; i < rows; i++) {
        for (var j = 0; j < columns; j++) {
            if (matrix[i][j] == 0) {
                continue;
            }
            if (i == 0 || j == 0) {
                submatrixSizes[i][j] = 1;
            }
            else {
                submatrixSizes[i][j] = Math.min(submatrixSizes[i - 1][j - 1], submatrixSizes[i - 1][j], submatrixSizes[i][j - 1]) + 1;
            }
            totalSubmatrices += submatrixSizes[i][j];
        }
    }
    return totalSubmatrices;
}
